const pickRandom = model => {
  const max = model.length;
  return Math.floor(Math.random() * Math.floor(max));
};

const seedScript = async () => {
  try {
    console.log("syncing db");
    await db.sync({ force: true });
    console.log("db synced");
    const createdBoards = await Board.bulkCreate(boards, {
      returning: true
    });
    const createdBoarders = await Boarder.bulkCreate(boarders, {
      returning: true // to get back autogenerated values aka, idk
    });
    const createdMakers = await Maker.bulkCreate(makers, {
      returning: true
    });
    const setBoarder = await Promise.all(
      createdBoards.forEach(board => board.setBoarder(pickRandom(boarders)))
    );
    const setMaker = await Promise.all(
      createdBoards.forEach(board => board.setMaker(pickRandom(makers)))
    );
    await Promise.all([setMaker, setBoarder]);
  } catch (err) {
    console.log(err);
  } finally {
    console.log("shutting db connection down");
    // db.close();
    console.log("db closed");
  }
};

seedScript();
